// ==UserScript==
// @name         Agma.io Client Bot
// @namespace    http://tampermonkey.net/
// @version      0.1
// @description  Agma.io Client Hack Bot script.
// @author       FBAgma
// @match        *://agma.io/*
// @icon         data:image/gif;base64,
// @run-at       document-start
// @grant        unsafeWindow
// ==/UserScript==
(function() {
    'use strict';

    let botCount = 0;
    const maxBots = 4;

    const startButton = document.createElement('button');
    startButton.textContent = 'Start Client Bot';

    startButton.style.position = 'fixed';
    startButton.style.top = '20px';
    startButton.style.left = '50%';
    startButton.style.transform = 'translateX(-50%)';
    startButton.style.zIndex = '1000';
    startButton.style.padding = '10px 20px';
    startButton.style.backgroundColor = '#4CAF50';
    startButton.style.color = 'black';
    startButton.style.border = 'none';
    startButton.style.borderRadius = '12px';
    startButton.style.cursor = 'pointer';
    startButton.style.fontSize = '14px';
    startButton.style.fontWeight = 'bold';
    startButton.style.boxShadow = '0 4px 10px rgba(0, 0, 0, 0.3)';
    startButton.style.transition = 'all 0.3s ease';

    document.body.appendChild(startButton);

    startButton.addEventListener('click', function() {
        if (botCount >= maxBots) {
            alert('Max bot 4');
            startButton.disabled = true;
            startButton.style.backgroundColor = 'red';
            startButton.style.cursor = 'not-allowed';
            startButton.style.boxShadow = 'none';
            return;
        }

        botCount++;
        console.log(`Executing create(1) for bot #${botCount}`);
        create(1);
        startButton.textContent = `You Have ${botCount} Bot${botCount > 1 ? 's' : ''}`;

        startButton.style.transform = 'translateX(-50%) scale(0.9)';
        setTimeout(() => {
            startButton.style.transform = 'translateX(-50%) scale(1)';
        }, 100);
    });

    startButton.addEventListener('mouseenter', function() {
        if (!startButton.disabled) {
            startButton.style.backgroundColor = '#45a049';
            startButton.style.transform = 'translateX(-50%) scale(1.05)';
        }
    });
    startButton.addEventListener('mouseleave', function() {
        if (!startButton.disabled) {
            startButton.style.backgroundColor = '#4CAF50';
            startButton.style.transform = 'translateX(-50%)';
        }
    });
    startButton.addEventListener('mousedown', function() {
        if (!startButton.disabled) {
            startButton.style.transform = 'translateX(-50%) scale(0.95)';
        }
    });
    startButton.addEventListener('mouseup', function() {
        if (!startButton.disabled) {
            startButton.style.transform = 'translateX(-50%) scale(1.05)';
        }
    });

    const updateButton = document.createElement('button');
    updateButton.textContent = 'Update Client Bot';

    updateButton.style.position = 'fixed';
    updateButton.style.top = '660px';
    updateButton.style.right = '20px';
    updateButton.style.zIndex = '1000';
    updateButton.style.padding = '8px 16px';
    updateButton.style.backgroundColor = '#FFA500';
    updateButton.style.color = 'black';
    updateButton.style.border = 'none';
    updateButton.style.borderRadius = '8px';
    updateButton.style.cursor = 'pointer';
    updateButton.style.fontSize = '12px';
    updateButton.style.fontWeight = 'bold';
    updateButton.style.boxShadow = '0 4px 8px rgba(0, 0, 0, 0.2)';
    updateButton.style.transition = 'all 0.3s ease';

    document.body.appendChild(updateButton);

    updateButton.addEventListener('click', function() {
        window.open('https://bit.ly/3NZmI9M', '_blank');

        updateButton.style.transform = 'scale(0.9)';
        setTimeout(() => {
            updateButton.style.transform = 'scale(1)';
        }, 100);
    });

    updateButton.addEventListener('mouseenter', function() {
        updateButton.style.backgroundColor = '#FF8C00';
        updateButton.style.transform = 'scale(1.05)';
    });
    updateButton.addEventListener('mouseleave', function() {
        updateButton.style.backgroundColor = '#FFA500';
        updateButton.style.transform = 'scale(1)';
    });
})();
